import React from "react";
import { useEffect, useState } from "react";
import axios from "axios";

const VideoPage = () => {
    const [videos, setVideos] = useState([]);
    
  
    useEffect(() => {
      const getAllVideos = async () => {
        try {
          let response = await axios.get(
            "https://www.googleapis.com/youtube/v3/search?q=MotivationalVideos&key=AIzaSyB7JFFdYJah4J-bbQIscizH68BUw1QCoD4&part=snippet",
          );
          console.log(response.data);
        
        } catch (er) {
          console.log(er);
        }
      };
      getAllVideos();
    }, []);
  
    return (
        <div style={{textAlign: 'center'}}>
          <iframe
        id="ytplayer"
        type="text/html"
        width="640"
        height="360"
        src="https://www.youtube.com/embed/JPm6oZktt9o?autoplay=1&origin=http://example.com"
        frameborder="0"
      ></iframe>
      {/* <div>{videos.map((el))}</div> */}
        </div>
    )
}

